import React from "react";
import dogPict from "./png-pictures/dog-pict.png";

const ClothingPage = () => {
  return (
    <div>
      <h1>ClothingPage</h1>
      <image src={dogPict}></image>
    </div>
  );
};

export default ClothingPage;
